import React from 'react'
import classes from './Messages.module.css'
import {NavLink} from 'react-router-dom'

const DialogItem = (props) => {
    let pathToDialog = 'messages/' + props.id;
    return (
        <div>
            <NavLink to={pathToDialog} className={navData() }>props.name</NavLink>
        </div>
    );
}

const Messages = () => {
    return (
        <div>
            <DialogItem id='1' name='Anton' />
        </div>
    );
}

const Message = () => {
    return (
        <div>
            <Message message="Hello" />
            <Message message="Yappi" />
            <Message message="YO" />
            <Message message="Hey" />
        </div>
    );
}

export default Messages
